import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
  useLocation
} from "react-router-dom";
import Home from "./views/Home"

function App() {

        return (
          <Router>
            <div>
              <Route exact={true} path='/' render={() => (
                <div className="App">
                  Hello
                </div>
              )}/>
              <Route exact={true} path='/signin' render={() => (
                <div className="App">
                  Hellou
                </div>
              )}/>
              <Route exact={true} path='/signup' render={() => (
                <div className="App">
                  Alloah
                </div>
              )}/>
            </div>
          </Router>
        );
}

export default App;
